// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

import "./Structs.sol";

/**
 * @title the NFT contract for Bops
 * @author Vijay Dhanasekaran
 */
contract BopsToken is ERC721, AccessControl {
    bytes32 public constant SONGS_MANAGER = keccak256("SONGS_MANAGER");
    bytes32 public constant SONG_CONTRACT = keccak256("SONG_CONTRACT");

    using Counters for Counters.Counter;
    Counters.Counter private _bopsTokenId;

    mapping(uint256 => address) private _bopsTokenOwners;
    mapping(uint256 => Bops) private _bopsTokens;

    event Minted(address indexed account, uint256 bopsTokenId, uint256 timestamp);
    event Burned(address indexed account, uint256 bopsTokenId, uint256 timestamp);
    event UpdatedLevel(address indexed account, uint256 bopsTokenId, uint256 level, uint256 timestamp);
    event IncreasedIntensity(address indexed account, uint256 bopsTokenId, uint256 amount, uint256 timestamp);
    event BurnedBeats(address indexed account, uint256 bopsTokenId, uint256 amount, uint256 timestamp);

    /**
     * @param name name of the token
     * @param symbol symbol of the token
     * @param _songsManagerAddress the address of the SongsManager contract
     */
    constructor(
        string memory name,
        string memory symbol,
        address _songsManagerAddress
    ) ERC721(name, symbol) {
        _setRoleAdmin(SONG_CONTRACT, SONGS_MANAGER);
        _setupRole(SONGS_MANAGER, _songsManagerAddress);
    }

    /**
     * @notice Bops struct getter (only for owner)
     * @param bopsTokenId The id of the media to retrieve
     * @return The struct with the Bops data
     */
    function getBops(uint256 bopsTokenId) external view onlyRole(SONG_CONTRACT) returns (Bops memory) {
        Bops memory bops = _bopsTokens[bopsTokenId];
        return bops;
    }

    /**
     * @notice Mint Bops NFT Token
     * @param to The address of the account holder
     * @param bopsData The Bops data struct
     */
    function mint(address to, Bops memory bopsData) public onlyRole(SONG_CONTRACT) {
        // generate new token id
        _bopsTokenId.increment();
        uint256 newTokenId = _bopsTokenId.current();
        bopsData.bopsId = newTokenId;

        _mint(to, newTokenId);

        // store in storage
        _bopsTokenOwners[newTokenId] = to;
        _bopsTokens[newTokenId] = bopsData;

        emit Minted(to, newTokenId, block.timestamp);
    }

    /**
     * @notice Burn Bops NFT Token
     * @param bopsTokenId The NFT token Id
     */
    function burn(uint256 bopsTokenId) public onlyRole(SONG_CONTRACT) {
        _burn(bopsTokenId);

        // remove token and  nullify
        delete _bopsTokenOwners[bopsTokenId];
        delete _bopsTokens[bopsTokenId];

        emit Burned(msg.sender, bopsTokenId, block.timestamp);
    }

    /**
     * @dev returns owner of tokenId
     **/
    function ownerOf(uint256 bopsTokenId) public view override returns (address) {
        return _bopsTokenOwners[bopsTokenId];
    }

    /**
     * @notice Update Bops level (only by the owner)
     * @param bopsTokenId The Bops NFT token Id
     * @param level The level to be updated
     */
    function updateLevel(uint256 bopsTokenId, uint256 level) external onlyRole(SONG_CONTRACT) {
        require(_bopsTokens[bopsTokenId].bopsId != 0, "Account does not have Bops");
        Bops storage bops = _bopsTokens[bopsTokenId];
        bops.level = level;

        emit UpdatedLevel(msg.sender, bopsTokenId, level, block.timestamp);
    }

    /**
     * @notice Increase the intensity (only by the owner)
     * @param bopsTokenId The Bops NFT token Id
     * @param intensity The intensity to be increased
     */
    function increaseIntensity(uint256 bopsTokenId, uint256 intensity) external onlyRole(SONG_CONTRACT) {
        require(_bopsTokens[bopsTokenId].bopsId != 0, "Account does not have Bops");
        Bops storage bops = _bopsTokens[bopsTokenId];
        bops.intensity += intensity;

        emit IncreasedIntensity(msg.sender, bops.bopsId, intensity, block.timestamp);
    }

    /**
     * @notice Burn beats (only by the owner)
     * @param bopsTokenId The Bops NFT token Id
     * @param beatsToBurn The amount of beats to be burnt
     */
    function burnBeats(uint256 bopsTokenId, uint256 beatsToBurn) external onlyRole(SONG_CONTRACT) {
        require(_bopsTokens[bopsTokenId].bopsId != 0, "Account does not have Bops");
        Bops storage bops = _bopsTokens[bopsTokenId];
        bops.beatsBurnt += beatsToBurn;

        emit BurnedBeats(msg.sender, bops.bopsId, beatsToBurn, block.timestamp);
    }

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, AccessControl)
        returns (bool)
    {
        return ERC721.supportsInterface(interfaceId) || AccessControl.supportsInterface(interfaceId);
    }
}

